import Header from "./Components/Header";
import Footer from "./Components/Footer";
import Content from "./Components/Content";
import Background from "./Components/Background";
function App() {
  return (
    <div className="App">
      <Background />
      <Header />
      <Content />
      <Footer />
    </div>
  );
}

export default App;
